(1525, 'Enter Subject', 'NA', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Enter Subject Enter Target Property', 'Enter Subject Enter Reason Property', 'Whatever Enter Reason Property Enter Target Property, as in the case of Enter Example', 'Gene Editing on Humans', 1, 'Enter timestamp of specified material', 'Catherine Racowsky, professor of obstetrics, gynecology and reproductive biology at Brigham and Women’s Hospital, Harvard researchers, others share their views on key issues in the field, The Harvard Gazette, January 9, 2019', '“Until the work is done, carefully and with tight oversight, to understand any off-target effects of replacing or removing a particular gene, it is inappropriate to apply the technology in the clinical field. My understanding of Dr. He’s case is that there wasn’t a known condition in these embryos, and by editing the genes involved with HIV infection, he could also have increased the risks of susceptibility to influenza and West Nile viruses.', '2022-03-26 13:55:46', 'support'),
