(1558, 'KSU\'s Office of Institutional Equity', 'does not willfully delay discrimination investigations', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'KSUs OIE', 0, 'NA', 'NA', 'NA', '2022-04-02 14:20:25', 'claim'),
(1559, 'KSU\'s Office of Institutional Equity', 'does not willfully delay discrimination investigations', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'KSU\'s Office of Institutional Equity does not willfully delay discrimination investigations', 'KSU\'s Office of Institutional Equity Enter Reason Property', 'Whatever Enter Reason Property does not willfully delay discrimination investigations, as in the case of Enter Example', 'KSUs OIE', 0, 'Enter timestamp of specified material', ', Processing, Investigation, and Resolution of Discrimination, Harassment, and Sexual Misconduct Complaints , , Accessed on 4-2-2022', '\"The amount of time needed to conduct investigations depends in part on the nature of the allegation(s) and the evidence to be investigated (e.g., the scope of the allegations, the time period and number of events implicated by or relevant to complaints, the number or availability of witnesses involved and the volume of documents).\"', '2022-04-02 14:20:25', 'support'),
(1560, 'KSU\'s Office of Institutional Equity', 'does not willfully disregard discrimination investigations', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'KSUs OIE', 1, 'NA', 'NA', 'NA', '2022-04-02 14:41:02', 'claim'),
(1561, 'KSU\'s Office of Institutional Equity', 'does not willfully disregard discrimination investigations', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'KSU\'s Office of Institutional Equity does not willfully disregard discrimination investigations', 'KSU\'s Office of Institutional Equity Enter Reason Property', 'Whatever Enter Reason Property does not willfully disregard discrimination investigations, as in the case of Enter Example', 'KSUs OIE', 1, 'Enter timestamp of specified material', ', Processing, Investigation, and Resolution of Discrimination, Harassment, and Sexual Misconduct Complaints , , Accessed on 4-2-2022', '\r\n\r\n    Home\r\n    About\r\n    Institutional Equity/Title IX\r\n        Non-Discrimination Policy\r\n        Title IX/Sexual Misconduct Policy\r\n        Process and Procedures\r\n        Support Services\r\n        Pregnant and Parenting Students\r\n    Reporting\r\n    Annual Security and Fire Safety Report\r\n\r\nProcess and Procedures\r\nProcessing, Investigation, and Resolution of Discrimination, Harassment, and Sexual Misconduct Complaints\r\n\r\nThe University’s complaint process, outlined herein, is the procedure used to investigate complaints or reports of discrimination and harassment, end any discrimination and/or harassment found, remedy the effects of discrimination and harassment, and prevent any recurrence or retaliation. This process applies to all complaints of discrimination and harassment except sexual misconduct complaints against students. \r\n\r\nThese procedures do not replace the right of the complainant to file complaints or seek remedies available under state or federal law. Please note that Complaints that do not meet the threshold under Title IX can be investigated under the general Sexual Misconduct Policy or other university policies. \r\n\r\nUniversity students and employees identified as witnesses are required to fully cooperate with an investigation. Any member of the University community who willfully disregards, delays, or thwarts an investigation, or makes false statements during an investigation, may be found in violation of a Kennesaw State University (\"KSU\") policy and subject to disciplinary action.\r\n\r\nInformation obtained during the course of the complaint process will be shared only to the extent necessary to conduct a thorough, fair, and impartial investigation.\r\n1) Interim Measures\r\n\r\nAfter OIE receives a complaint, the Director of Institutional Equity & Title IX Coordinator (\"Director\"), or his/her designee, may implement interim protective measures before the final outcome of an investigation if failure to take the interim measures would constitute a threat to the safety and well-being of the complainant or other members of the University community. Additionally, the Director, or his/her designee, may implement interim protective measures to ensure equal access to the University’s education programs and activities. Such interim measures are not an indication that a violation of the Non-Discrimination and/or Sexual Misconduct Policies has occurred. Interim measures will remain effective during the investigation process, and can be extended further if in the best interests of the parties and campus community.\r\n2) Initiating an Investigation\r\n\r\nAs part of the fact-finding process, the investigator will:\r\n\r\nConduct and initial intake interview to obtain additional information regarding the alleged behavior, provide complainant(s) with information on where to access the Non-Discrimination and/or Sexual Misconduct Policy or provide a copy of the policy;\r\nDetermine whether the complainant\'s allegations fall under the policy and, if they do not, refer complainant to the appropriate University or off-campus resources;\r\nInform respondents of complaints brought against them and, upon request, provide respondents with information on where to access the policy or provide a copy of the policy; and,\r\nInform all parties of the University’s Non-Retaliation Policy.\r\n3) Informal Process\r\n\r\nThe informal process is an opportunity to bring resolution to a complaint through awareness, education, and/or a facilitated discussion. Informal resolution may be appropriate if the complainant, respondent, and Director or his/her designee all agree. \r\n\r\nDuring an informal process, fact-finding occurs to the extent necessary to resolve the conflict and protect the interest of the parties and the University community, but the process stops short of a determination of whether a policy has been violated. Instead, the focus is on finding resolutions that might end the conflict to the satisfaction of all parties involved and the University. The complainant or respondent always has the option to end the informal process and request a formal process.\r\n\r\nInformal resolutions may include, but are not limited to:\r\n\r\n    Training;\r\n    Changes to work or academic arrangements;\r\n    Housing reassignment;\r\n    Informal discussion with person whose conduct, if not stopped, could rise to the level of discrimination or harassment; and/or\r\n    Advisory discussion with the respondent’s supervisor, professor or advisor.\r\n     \r\n\r\n4) Formal Process\r\n\r\nAll complaints that are not resolved through the informal process may be resolved through a formal process involving a full investigation conducted by an assigned investigator.\r\n\r\nAs part of the formal process, the investigator will:\r\n\r\n    Inform complainants and respondents of their right to be interviewed and provide evidence;\r\n    Obtain information and evidence, including the identity of any witnesses, from complainants and the respondents;\r\n    Attempt to obtain information from the identified witnesses;\r\n    Collect and maintain appropriate documentation;\r\n    Only disclose appropriate information to others on a need-to-know basis; and,\r\n    Keep the appropriate supervisors/administrators/faculty informed of the status of\r\n    investigations.\r\n', '2022-04-02 14:41:02', 'support'),
