(1633, 'Social media', 'can help mental health through finding connections and support', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Social media can help mental health through finding connections and support', 'Social media Enter Reason Property', 'Whatever Enter Reason Property can help mental health through finding connections and support, as in the case of Enter Example', 'Social Media', 0, 'Enter timestamp of specified material', ', Social media benefits, Internetmatters.org, ', '\"Social media removes the boundaries of meeting and maintaining people and forming bonds beyond borders. For children who may have a disability or may not feel they can connect with others within their community, it can be a great way to connect with other people who share their ideas and interests.It can open up opportunities to offer support to friends and family that may be experiencing a particular issue. On the flip side for some young people, it can be a place where they can seek support if they are going through something that they cannot talk to those close to them about.\"', '2022-04-09 13:13:58', 'support'),
(1634, 'Social media', 'has a negative impact on society', 'Testimony', '', 'Enter Example', 'Enter URL', '', 'Enter Subject Enter Target Property', 'Enter Subject ', 'Whatever  Enter Target Property, as in the case of Enter Example', 'Social Media', 1, 'Enter timestamp of specified material', 'Rachel Ehmke, How Using Social Media Affects Teenagers, Child Mind Institute, ', '\"There’s no question kids are missing out on very critical social skills. In a way, texting and online communicating—it’s not like it creates a nonverbal learning disability, but it puts everybody in a nonverbal disabled context, where body language, facial expression, and even the smallest kinds of vocal reactions are rendered invisible.”', '2022-04-09 13:17:25', 'support'),
(1635, 'Social media', 'does not help mental health, and connection online actually hurts them', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Social Media', 1, 'NA', 'NA', 'NA', '2022-04-09 13:28:54', 'claim'),
