(1650, 'It is known', 'that social media is a threat to democracy', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'It is known that social media is a threat to democracy', 'It is known Enter Reason Property', 'Whatever Enter Reason Property that social media is a threat to democracy, as in the case of Enter Example', 'Social Media', 1, 'Enter timestamp of specified material', 'Tom Glaisyer , IS SOCIAL MEDIA A THREAT TO DEMOCRACY?, Democracy Fund, October 4, 2017', 'As my co-authors – Stacy Donohue and Anamitra Deb – and I reviewed the research of leading voices on this set of issues, we identified six key ways social media is threatening democracy: Exacerbating the polarization of civil society via echo chambers and filter bubbles, Rapidly spreading mis- and dis-information and amplifying the populist and illiberal wave across the globe, Creating competing realities driven by their algorithms’ intertwining of popularity and legitimacy, Being vulnerable to political capture and voter manipulation through enabling malevolent actors to spread dis-information and covertly influence public opinion, Capturing unprecedented amounts of data that can be used to manipulate user behavior, and Facilitating hate speech, public humiliation, and the targeted marginalization of disadvantaged or minority voices.', '2022-04-09 13:57:28', 'support'),
(1651, 'It is known', 'that social media is a threat to democracy', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Enter Subject Enter Target Property', 'Enter Subject Enter Reason Property', 'Whatever Enter Reason Property Enter Target Property, as in the case of Enter Example', 'Social Media', 1, 'Enter timestamp of specified material', 'Pierre Omidyar, 6 Ways Social Media Has Become A Direct Threat To Democracy, New Perspectives Quarterly, 05 February 2018', '\"Trolls and bots, disguised as ordinary citizens, have become a weapon of choice for governments and political leaders to shape online conversations\"', '2022-04-09 14:02:28', 'support'),
(1652, 'It is known', 'that social media is a threat to democracy', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Enter Subject Enter Target Property', 'Enter Subject Enter Reason Property', 'Whatever Enter Reason Property Enter Target Property, as in the case of Enter Example', 'Social Media', 1, 'Enter timestamp of specified material', 'Andreas Kaplan, Artificial Intelligence, Social Media, and Fake News: Is This The End of Democracy?, Digital Transformation in Media & Society, 2020', '\"Social media is increasingly used to spread misinformation, so-called fake news, potentially\r\nthreatening democratic processes and national interests. This chapter looks at social media\r\nand how they moved from being regarded as a positive force in the public sphere to a negative one. AI\r\nwill be explained, and its potential in the context of social media will be decrypted. Consequently, AI,\r\nsocial media, and fake news will be analysed and the apparent threat to democratic functions explored.\"', '2022-04-09 14:06:40', 'support'),
