(1679, 'It\'s not clear that', 'the death penalty increases homicides', 'Tarka', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'It\'s not clear that the death penalty increases homicides', 'It\'s not clear that Enter Reason Property', 'Whatever Enter Reason Property the death penalty increases homicides, as in the case of Enter Example', 'Death Penalty', 1, 'Enter timestamp of specified material', 'Author, Title, Publication, Date of Publication', 'Transcription ', '2022-04-15 01:11:02', 'support'),
(1680, 'The Death Penalty', 'causes an increase in homicides', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Death Penalty', 0, 'NA', 'NA', 'NA', '2022-04-15 01:14:31', 'claim'),
(1681, 'The Death Penalty', 'causes an increase in homicides', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'The Death Penalty causes an increase in homicides', 'The Death Penalty Enter Reason Property', 'Whatever Enter Reason Property causes an increase in homicides, as in the case of Enter Example', 'Death Penalty', 1, 'Enter timestamp of specified material', 'W J Bowers; \r\nG L Pierce, Deterrence or Brutalization - What Is the Effect of Executions?, Crime and Delinquency Volume: 26 Issue: 4  Pages: 453-484, October 1980', '\"An examination of State executions and homicides in New York over a 57-year period leads to the conclusion that State executions do not have a deterrent effect on the commission of capital crimes but rather a brutalizing effect reflected in increased homicide rates in months following executions... The study found that, on the average, homicides increased by two or three in months immediately following executions and by one incident 2 months after executions and decreased at a statistically insignificant rate in the third month... The effect of executions has been to increase homicides, not to deter them. These findings represent a direct challenge to the constitutionality of the death penalty regarding its negative impact on the victims of homicides sparked by executions.\"', '2022-04-15 01:14:31', 'support'),
