(1683, 'The Death Penalty', 'causes an increase in homicides', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Enter Subject Enter Target Property', 'Enter Subject Enter Reason Property', 'Whatever Enter Reason Property Enter Target Property, as in the case of Enter Example', 'Death Penalty', 1, 'Enter timestamp of specified material', 'William C. Bailey, Deterrence, Brutalization, and the Death Penalty: Another\r\nExamination of Oklahoma\'s Return to Capital Punishment, Criminology, 36(4), 711-734. doi:10.1111/j.1745-9125.1998.tb01263.x, 1998', '\"First, after taking into consideration the sociodemographic control variables, the execution frequency, and media coverage factors, the evidence persisted that the Coleman execution was followed by a significant increase in total stranger killings and stranger homicides not involving other felonies... These findings suggest that executions that occurred in other states may have had a brutalization consequence in Oklahoma.\"', '2022-04-15 01:30:15', 'support'),
