(1701, 'Trophy hunting', 'does not control population size', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting does not control population size', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property does not control population size, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', 'Dr. Mark Jones, DOES TROPHY HUNTING HELP CONSERVATION?, Born Free, ', '\"“Claims by trophy hunters that they are primarily concerned about wildlife conservation or animal management are highly misleading. Trophy hunters don’t target problem or surplus animals; instead they covet those animals with the most impressive traits – the largest tusks, or the darkest manes. By doing so they remove key individuals, severely disrupting animal families and populations.\"', '2022-04-16 03:29:36', 'support'),
(1702, 'Trophy hunting', 'does not fund conservation efforts', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Trophy Hunting', 0, 'NA', 'NA', 'NA', '2022-04-16 03:31:53', 'claim'),
(1703, 'Trophy hunting', 'does not fund conservation efforts', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting does not fund conservation efforts', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property does not fund conservation efforts, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', 'Dr. Mark Jones, DOES TROPHY HUNTING HELP CONSERVATION?, Born Free, ', '\"Trophy hunting is not a conservation or animal management tool, nor does it contribute significant funds to conservation programmes or local communities; it is a cruel relic from colonial times that should be consigned to history where it belongs.” ', '2022-04-16 03:31:53', 'support'),
