(1707, 'Trophy hunting', 'negatively impacts ecosystem', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting negatively impacts ecosystem', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property negatively impacts ecosystem, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', ', Trophy hunting may cause extinction in a changing environment, ScienceDaily, November 28, 2018', '\"Trophy hunting and other activities involving the targeting of high-quality male animals could lead to the extinction of certain species faced with changing environmental conditions, according to new research.\"', '2022-04-16 03:42:36', 'support'),
(1708, 'Trophy hunting', 'does not eliminate poaching', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Trophy Hunting', 0, 'NA', 'NA', 'NA', '2022-04-16 03:47:42', 'claim'),
(1709, 'Trophy hunting', 'does not eliminate poaching', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting does not eliminate poaching', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property does not eliminate poaching, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', 'Elliott Morley MP , The Myth of Trophy Hunting\r\nas Conservation, Bloodybusiness.com, December 2004', '\"Opening up even a limited legal trade creates a smokescreen for poachers which is almost impossible to police. Prior to 1986, when the whaling moratorium was introduced, legal quotas were widely used as covers for poaching, driving some species near to extinction. The same is happening with trophy hunting of endangered species.\"', '2022-04-16 03:47:42', 'support'),
(1710, 'Trophy hunting', 'does fund conservation efforts', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Trophy Hunting', 0, 'NA', 'NA', 'NA', '2022-04-16 03:51:15', 'claim'),
(1711, 'Trophy hunting', 'does fund conservation efforts', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting does fund conservation efforts', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property does fund conservation efforts, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', 'Catherine E. Semcer, Conservationists Should Support Trophy Hunting:\r\nWhy I joined 132 researchers in signing an open letter in Science Magazine, perc.org, September 6, 2019', '\"This habitat conservation is a direct result of the fact that trophy hunting can be profitable for landowners and community members. In South Africa, most hunting reserves are former cattle ranches that were converted to wildlife conservation after legal changes allowed landowners to hold property rights in wildlife. These property rights give landowners incentives to maintain high-quality habitat on their land. They also encourage healthy wildlife populations that enable owners to sell hunting opportunities that, together with value added products like game meat, are worth an estimated $131 million per year to rural South Africans.\"', '2022-04-16 03:51:15', 'support'),
(1712, 'Trophy hunting', 'eliminates poaching', 'NA', 'NA', '', 'NA', 'NA', 'NA', 'NA', 'NA', 'Trophy Hunting', 0, 'NA', 'NA', 'NA', '2022-04-16 03:55:48', 'claim'),
(1713, 'Trophy hunting', 'eliminates poaching', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Trophy hunting eliminates poaching', 'Trophy hunting Enter Reason Property', 'Whatever Enter Reason Property eliminates poaching, as in the case of Enter Example', 'Trophy Hunting', 1, 'Enter timestamp of specified material', 'Catherine E. Semcer, Conservationists Should Support Trophy Hunting, perc.org, September 6, 2019', '\" In Tanzania, all of the expenses related to the government’s anti-poaching activities are funded by trophy hunting revenues. These anti-poaching activities help limit poaching, which, along with habitat loss, have been identified as one of the most significant threats to the world’s biodiversity.\r\n\r\nThose seeking to ban all trophy hunting should take note of the fact that following U.S. and European Union bans on the importation of lion trophies from Tanzania, the revenues to fund these anti-poaching units decreased by 23 percent, resulting in a corresponding decrease in the ability of rangers to safeguard wildlife.\"', '2022-04-16 03:55:48', 'support'),
