(1718, 'Smoking cigarettes', ' should be banned in a public space', 'Testimony', '', 'Enter Example', 'Enter URL', 'Enter Reason Property', 'Enter Subject Enter Target Property', 'Enter Subject Enter Reason Property', 'Whatever Enter Reason Property Enter Target Property, as in the case of Enter Example', 'Smoking Ban in Public Space', 1, 'Enter timestamp of specified material', ', Study Shows Smoking Bans Benefit Kids, Brigham Health Hub, ', '\"Laws that prohibit smoking in public places, such as bars, restaurants, and workplaces, are proven to protect adults from the health threats associated with passive smoking. In the first comprehensive study to look at how anti-smoking laws are affecting the health of children, researchers from Brigham and Women’s Hospital, Harvard Medical School, the University of Edinburgh, Maastricht University, and Hasselt University found that the introduction of new laws that ban smoking in public places in North America and Europe has been followed by a decrease in rates of premature births and hospital visits for asthma attacks in children. These findings were published in March 2014 in The Lancet.\"', '2022-04-16 04:20:18', 'support'),
